    super(props);

    this.state = {
      active: 'home'
    }
  }

  render() {
    return (
      <Router basename={process.env.PUBLIC_URL}>
        <div>
          <Navigation />
          <Route exact path="/" component={ About } />
          <Route path={process.env.PUBLIC_URL + "/recipes"} component={ Recipes } />
        </div>
      </Router>
    )

  }
}

export default App;
